INSERT INTO `temple_location` VALUES (1,1,'美食','./images/moonMap/咖啡icon.svg','Share House Cafe','僻靜巷弄裡的老屋咖啡店，是個適合歇腳放鬆的好去處。','營業時間：週二至周日 09:00-18:30','地址：台南市中西區新美街111號','https://goo.gl/maps/XND8vZv5XkZj1zgz6',1),(2,1,'美食','./images/moonMap/餐廳icon.svg','福泰飯桌','有著許多人公認台南最好吃的蝦捲，還有晚來就點不到的紅燒肉，尖峰時刻總是座無虛席。','營業時間：周一至周五 07:30-14:30','地址：台南市中西區民族路二段240號','https://goo.gl/maps/PmMqV3NLQ6jstnok6',1),(3,1,'美食','./images/moonMap/餐廳icon.svg','松村煙燻滷味','獨特煙燻味，鹹香帶甜味的在地口味，價格實惠，是來台南必買的伴手禮之一 。','營業時間：周一至周日11：30-21：30','地址：台南市中西區民族路二段319號','https://goo.gl/maps/srwUgmCnN4FUbKck9',1),(4,1,'景點','./images/moonMap/景點icon.svg','赤崁文化園區','早期台南舊城發展的中心，區內古蹟眾多，是台灣少數擁有荷蘭、鄭氏建築的文化園區。','營業時間：周一至週日08:30-21:30','地址：台南市中西區民族路二段212號','https://goo.gl/maps/ZfvrSibayyMm9Y3E9',1),(5,1,'景點','./images/moonMap/景點icon.svg','開基武廟原正殿','為1669年全台灣首座興建的關帝廟，故名為「開基武廟」。又因該廟與祀典武廟同樣祭祀關公但且面積較小，因此一般人都稱此廟為小關帝廟。','營業時間：周一至周日 07:00-21:00','地址：台南市中西區新美街114號','https://goo.gl/maps/vC1opwBczeFr8CECA',1),(6,1,'景點','./images/moonMap/景點icon.svg','祀典武廟','台最早關帝廟，也是當時官建的祀典廟宇之一，裡面祀奉正氣凜然的關聖帝君，被稱為大關帝廟。','營業時間：周一至周日06:00-21:00','地址：台南市中西區永福路二段229號','https://goo.gl/maps/xcgZohQYSW2qRWMn6',1),(7,2,'美食','./images/moonMap/餐廳icon.svg','廟邊假魚肚','北港人愛吃鮸魚肚羹湯，又礙於價高，因此以豬皮代替鮸魚肚皮作羹，假魚肚也成了北港特有小吃,當初的攤子，傳承至第三代已成廟旁生意鼎盛的老店。','營業時間：周一至周日08:00-17:00','地址：雲林縣北港鎮中山路186號','https://goo.gl/maps/RnrgnvohVkGp5h819',1),(8,2,'美食','./images/moonMap/餐廳icon.svg','福安鴨肉飯','北港福安鴨肉飯是在地人口中真正的好味道,80多年歷史的老店。一般鴨肉肉質較鵝肉粗，這裡的鴨肉不僅香氣濃郁，肉質更是軟嫩。除了招牌鴨肉飯以外，乾鴨肉冬粉更是一絕。','營業時間：周一至周日11:00-19:00','地址：雲林縣北港鎮中山路37號','https://goo.gl/maps/ZHvEKNJ1PjdLp9Yz9',1),(9,2,'美食','./images/moonMap/餐廳icon.svg','趙街尾鴨肉羹','店家是50年歷史的老店,店裡招牌的鴨肉羹選用新鮮的現宰鴨隻，經生鮮處理後，以青蔥、洋蔥等佐料炒過，加上筍絲、榨菜絲搭上太白粉等芶芡成羹，特殊的風味在北港才享受得到。','營業時間：周一至周日09:30-20:00','地址：雲林縣北港鎮中山路38號','https://goo.gl/maps/JEBvoqFuRJyWHTBv7',1),(10,2,'景點','./images/moonMap/景點icon.svg','北港工藝坊','北港工藝坊建於西元1964年，是北港甕牆的所在，也是稅務分局舊宿舍地址，於2013年12月20日正式開館，以北港宗教工藝產業為主體的據點，保留著50年代街巷老屋的古樸韻味。','營業時間：周三至周日10:00-16:00','地址：雲林縣北港鎮共和街2號','https://goo.gl/maps/VTLBSrTseTLiqPNJ7',1),(11,2,'景點','./images/moonMap/景點icon.svg','光明屋書店','雲林縣北港鎮光明屋獨立書店利用60年歷史的老建物整修而成，1樓書籍展示室原為診所木製看診間，2樓音樂懷舊空間蒐集大量老唱片，充滿5、60年代風情。獲選為雲林特色店家。','營業時間：周三至周日09:00-17:00','地址：雲林縣北港鎮光明路122號','https://goo.gl/maps/FA1hX9g1bvwugGKC7',1),(12,2,'景點','./images/moonMap/景點icon.svg','北港水道頭文化園區','日文稱為「水道頭」的自來水廠，建於西元1930年，聳立在北港一號堤防旁，以北港溪流作為水源，鋼筋水泥結構的十角造型非常特殊，一旁的抽水機機房以清水磚砌成屋身，是日治時期僅存的代表建築。','營業時間：周一至周日24小時營業','地址：雲林縣北港鎮民生路1號','https://goo.gl/maps/FwQdAVaornxYieZf7',1),(13,3,'美食','./images/moonMap/餐廳icon.svg','阿米奇義式廚房','位在台中精明商圈裡的人氣義大利麵餐廳。無論平假日都是座無虛席！','營業時間：周日至周三 11：00-22：30,周四至週六營業至23：00','地址：台中市西屯區精明二街33號','https://goo.gl/maps/EFUNQ7E6KA5Z8jdG6',1),(14,3,'美食','./images/moonMap/餐廳icon.svg','小野食堂','日式定食和咖哩餐廳。特色為老宅改建的舒適餐廳空間和招牌牛肉咖哩。','營業時間：周一至周日11:30-15:00,17:30-20:30(周二公休)','地址：台中市西區精誠五街17號','https://goo.gl/maps/1g24uRxjQ8QDwSfM8',1),(15,3,'美食','./images/moonMap/餐廳icon.svg','精誠牛肉麵豬腳麵','招牌為牛肉麵裡的滷牛腱，一條牛腱只做兩碗麵。另外內行人也推薦豬腳麵！','營業時間：周一至周日11:30-21:30','地址：台中市西屯區精誠路34號','https://goo.gl/maps/tmQt7D2Sm9Y9z5it6',1),(16,3,'景點','./images/moonMap/景點icon.svg','幻覺博物館','幻覺博物館始於克羅埃西亞，是以錯覺藝術為主題的教育娛樂場館，全球已有22間分館，台灣館在2020年4月12日開幕。','營業時間：周三至周日10:00-21:00','地址：台中市西區精誠路66號','https://goo.gl/maps/xPw4XydkSDi9MbGc8',1),(17,3,'景點','./images/moonMap/景點icon.svg','國立自然科學博物館','於1993年落成後對外開放，是台灣第一座設立的國家級科學博物館。科博館內包含六個展場：太空劇院、科學中心、生命科學館、人類文化廳、地球環境廳和植物園。','營業時間：周二至周日09:00-17:00','地址：台中市北區館前路1號','https://goo.gl/maps/eajtdW48GiU9uyEa6',1),(18,3,'景點','./images/moonMap/景點icon.svg','臺中國家歌劇院','由曾獲普立茲克獎的日本建築師伊東豊雄設計。以「美聲涵洞」概念，採用曲牆、孔洞與管狀等特殊設計，整棟建築完全沒有樑柱支撐，也無一處為90度牆面，顛覆了一般建築物的概念。','營業時間：周二至周日11:30-21:00','地址：台中市西屯區惠來路二段101號','https://goo.gl/maps/MBdWkEn129eJnbfQ7',1),(19,4,'美食','./images/moonMap/餐廳icon.svg','旱溪肉圓','老字號肉圓店,料多味美是網友高評價的美食店。','營業時間：周一至周日15：30-23：30','地址：台中市東區東光園路592號','https://goo.gl/maps/KemvWFc51oDp8JfW8',1),(20,4,'美食','./images/moonMap/餐廳icon.svg','旱溪人鋒涼麵','25年老店涼麵,只要30元便宜又大碗。','營業時間：周一至周日06:00-20:00','地址：台中市東區旱溪街44號','https://goo.gl/maps/GKmjL1inNFs1G8K29',1),(21,4,'美食','./images/moonMap/餐廳icon.svg','旱溪臭豆腐','臭豆腐外酥內軟,適合下午茶時段當點心。','營業時間：周二至周日13:30-18:00(周一與周四公休)','地址：台中市東區旱溪街52-3號','https://goo.gl/maps/H2NwFTxdaAeGLuBy8',1),(22,4,'景點','./images/moonMap/景點icon.svg','綠川水岸廊道','中區綠川原名「新盛溪」，於1912年更名，是日據時期臺中「小京都」計畫中的亮點河川，小小一條新盛橋(現中山綠橋)是當時臺中八大夜景之一。','營業時間：周一至周日08:00-22:00','地址：台中市中區綠川東西街','https://goo.gl/maps/1nf2PL2zYxBBeE4b6',1),(23,4,'景點','./images/moonMap/景點icon.svg','臺中公園','臺中公園自1903年10月28日創立以來，一直是臺中市重要的地標，公園內設有人工湖、亭臺樓閣、曲橋等優美造景，還有露天音樂臺、兒童遊戲區、網球場等多項遊樂設施。','營業時間：周一至周日24小時開放','地址：臺中市北區雙十路一段65號','https://goo.gl/maps/ZoWpZuMHwf8HaQfL9',1),(24,4,'景點','./images/moonMap/景點icon.svg','新天地西洋博物館','熱愛骨董的老闆常到世界各地收集、連拍賣會都曾有過它的蹤跡，因收集了許多價值不斐的西洋古物，所以打造了西洋博物館來跟展示這些西方古代貴族愛用的物品。','營業時間：周一至周日10:00-20:00','地址：台中市東區旱溪東路一段456號','https://goo.gl/maps/7mqvGLhYiJXYrjpR7',1),(25,5,'美食','./images/moonMap/餐廳icon.svg','冰雪糖冰舖(冰雪蔬蔬)','以超大碗的芋頭冰聞名，臨近萬華火車站，店面相當細小，一不留神就會錯過，另外位置也不多。','營業時間：周一至周日11：00-18：00(週五公休)','地址：台北市萬華區環河南路二段71巷7號','https://goo.gl/maps/v39S65JWWvao8ErPA',1),(26,5,'美食','./images/moonMap/餐廳icon.svg','福州元祖胡椒餅','捷運萬華站的旁邊，有一家排隊胡椒餅福州元祖胡椒餅，它有一個很可愛的品牌名稱是「武林萌主」。隱藏在小小的巷弄。','營業時間：周一至周日10：00-18：30','地址：台北市萬華區和平西路三段89巷2弄5號','https://goo.gl/maps/oy5ez7KeprBYxHv59',1),(27,5,'美食','./images/moonMap/餐廳icon.svg','亞東甜不辣','座落於萬華，西門町附近巷弄裡，1965年（民國54年）創立至今已50年了。不只賣甜不辣而已，還有高麗菜捲和炸類。','營業時間：周二至周日09：00-18：00(周一公休)','地址：台北市萬華區西園路一段56號','https://goo.gl/maps/jW1BBjrqodRWfnwT7',1),(28,5,'景點','./images/moonMap/景點icon.svg','清水巖','艋舺清水巖是艋舺電影的拍攝地，也是台灣的三級古蹟，恭奉的清水祖師有著黑臉與落鼻的特色。','營業時間：無特定營業時間，晚上門會關起來','地址：台北市萬華區康定路81號','https://goo.gl/maps/uXTmSCsumYcxdXjS6',1),(29,5,'景點','./images/moonMap/景點icon.svg','剝皮寮','剝皮寮跟大稻埕從清朝、日據時代到民初一直是台北重要的商業中心，就像現在的信義區一樣。饒富特色的是直到現在依舊保留著百餘年前街道的風貌，紅磚牆、拱型騎樓、雕花的窗櫺。','營業時間：周一至周日09：00-21：00','地址：台北市萬華區康定路173巷','https://goo.gl/maps/SFQGG4tjerQqSW6x9',1),(30,5,'景點','./images/moonMap/景點icon.svg','時報本舖','書的所在，人的所在，心的所在 時報出版旗下之回頭書店，販售從各通路送回家的「回頭書」、時報出版代理書籍、文創商品、咖啡輕食，並不定期舉辦各式活動。','營業時間：周一至周日11：00-18：00','地址：台北市萬華區和平西路三段240號1樓','https://goo.gl/maps/8SAVkRqs8DpE9Gtq9',1),(31,6,'美食','./images/moonMap/餐廳icon.svg','顏記杏仁露','該店是迪化街的傳統甜品店，販售著古早味的冰品、甜湯冰的熱的都有，杏仁露是店裡的招牌，炎炎夏日來一碗相當消暑。','營業時間：周二至周日09：30-18：30(周一公休)','地址：台北市大同區迪化街一段21號永樂市場一樓1204室','https://goo.gl/maps/nVV2GEdqbNo5ySXw8',1),(32,6,'美食','./images/moonMap/餐廳icon.svg','鹹花生咖啡館','鹹花生Salt Peanuts的所在地就是一間百年老洋房，兩層樓的口型街屋，中間有個綠意盎然的天井花園是一大賣點，以肉桂捲最為出名。','營業時間：周一至周日10：00-18：00','地址：台北市大同區迪化街一段197號','https://goo.gl/maps/5xcsz1oz4RL8LvBj8',1),(33,6,'美食','./images/moonMap/餐廳icon.svg','妙口四神湯.肉包專賣店','「妙口四神湯肉包專賣店」已有將近50年歷史，肉包僅有一種口味，還販售四神湯，兩樣食物的搭配簡直是絕配，就如肉圓配四神湯一樣經典。','營業時間：周二至周日11：30-17：00(周一公休)','地址：台北市大同區民生西路388號','https://goo.gl/maps/Lj65J8BRjE3QQdqG6',1),(34,6,'景點','./images/moonMap/景點icon.svg','永樂市場','永樂市場成立於1908年，原名為「公設永樂町食料品小賣市場」，做為日本印花布料的進口批發中心，光復後因廠商研發與政府鼓勵，逐漸成為全台灣最大的布料批發零售中心。','營業時間：周一至周六09：00-18：00(周日公休)','地址：台北市大同區迪化街一段21號','https://goo.gl/maps/TPiJ9zpaPw1nC33NA',1),(35,6,'景點','./images/moonMap/景點icon.svg','迪化街','迪化街上的店家大約有250家，其範圍包括了南京西路至歸綏街口、甘州街、保安街交叉口朝陽公園、甘谷街、南京西路一帶，台北有名的年貨大街。','營業時間：周一至周日24小時開放','地址：台北市大同區迪化街一段','https://goo.gl/maps/Xdo8ZmfTSFD8awua6',1),(36,6,'景點','./images/moonMap/景點icon.svg','大稻埕碼頭','大稻埕的發展歷史，與大稻埕碼頭有著密切的關係，淡水開港通商，外商洋行紛紛到此開設商號，促成大稻埕往後的繁華。現今雖然碼頭功能不復當年，但已轉型為民眾休閒遊憩的去處。。','營業時間：周一至周日24小時開放','地址：臺北市大同區大稻埕碼頭','https://goo.gl/maps/hvqhupZa1R4L5tZo9',1);
