--
-- Table structure for table `temple_msg`
--

DROP TABLE IF EXISTS `temple_msg`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `temple_msg` (
  `ID` varchar(255) NOT NULL COMMENT '廟宇留言編號',
  `tMEMBER_ID` int NOT NULL COMMENT '會員編號',
  `tTEMPLE_ID` int NOT NULL COMMENT '廟宇編號\\n',
  `IMAGE` varchar(255) DEFAULT NULL COMMENT '圖片',
  `MSG` varchar(255) NOT NULL COMMENT '留言內容',
  `MSG_DATE` date NOT NULL COMMENT '留言日期',
  `STATUS` tinyint(1) NOT NULL COMMENT '留言狀態',
  PRIMARY KEY (`ID`),
  KEY `FK_MEMBER_MEMBER_ID_idx` (`tMEMBER_ID`),
  KEY `FK_TEMPLE_tTEMPLE_ID_idx` (`tTEMPLE_ID`),
  CONSTRAINT `FK_MEMBER_tMEMBER_ID` FOREIGN KEY (`tMEMBER_ID`) REFERENCES `member` (`ID`),
  CONSTRAINT `FK_TEMPLE_tTEMPLE_ID` FOREIGN KEY (`tTEMPLE_ID`) REFERENCES `temple` (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='廟宇留言版';
/*!40101 SET character_set_client = @saved_cs_client */;

